def cosineSimilarity(x: Array[Float], y: Array[Float]): Double = {
  val dot = x.zip(y).map(a => a._1 * a._2).sum
  val magX = math.sqrt(x.map(i => i*i).sum)
  val magY = math.sqrt(y.map(i => i*i).sum)
  dot / (magX * magY)
}

